  helpText = "Help text"
  render() {
    return (<div className="name">
      <Header title="Shapka saita" />
    <h1>{this.helpText}</h1>
    <input placeholder={this.helpText} onClick = {this.inputClick} mouseOver={this.mouseOver}></input>
    <p>{this.helpText === "Help text!" ? "Yes" : "No"}</p>
    <Image image = {logo}/>
    <img style={width} src={logo} />
    <Footer />
  </div>)
  }

